var Taf = require("../../libjce");
var Ext = require("../jce/ExtProxy.js").Ext;

var abcd = new Taf.BinBuffer();
abcd.writeInt32(12345678);

var ext = new Ext.ExtInfo();
ext.readFromObject({
    "data":{"abcd":abcd},
    "cons":{"data":{"abcd":abcd}}
});

var binBuffer=ext.toBinBuffer();

var ist=new Taf.JceInputStream(binBuffer);
var ext_decode=Ext.ExtInfo.create(ist);
console.log("struct Object:", ext_decode.toObject());

